import React, { Component } from 'react';
import {Form, Icon, Input, Button, Select, Slider} from 'antd';
import { Cascader } from 'antd';
import './SearchForm.css';


const Option = Select.Option;



class SearchForm extends Component {
    render() {
        const AntWrappedLoginForm = Form.create()(Search)
        return (
            <div className="login-container">
                <div className="login-content">
                    <AntWrappedLoginForm />
                </div>
            </div>
        );
    }
}

class Search extends Component {
  handleSubmit = name => event => {
      this.setState({
        [name]: event.target.value,
      });
    };

  render() {

    const marks = {
  0: '$10',
  100: '$150'
  };
    const services = [
      "Dog Boarding", "Dog Sitting", "Dog Pooping"
    ]
    const { getFieldDecorator } = this.props.form;
    function handleChange(value) {
      console.log(value);
    }
    return (
      <Form>
      <Form.Item
        label="Service"
        className="service-label"
       >
        <Select
          size="large"
          name="role"
          autoComplete="off"
        style={{ width: '100%' }}
        placeholder="Please select"
        defaultValue={['Dog Boarding']}
        onChange={handleChange}
        >
        {services.map(service => <Option key={service}>{service}</Option>)}

        </Select>
        </Form.Item>
        <div className="slider-label">
        <p>Rate</p>
        </div>
        <Form.Item>
         <Slider marks={marks} defaultValue={37} tooltipVisible/>
         </Form.Item>

        </Form>


    );
  }
}


export default SearchForm;
